script: |
  super -f text -I q7764.spq | sort > q7764.out

inputs:
  - name: q7764.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 + - + ( - col1 ) NOT BETWEEN - col2 + - - 45 AND - - col0 + - - 74 * - + 60;
  - name: tab2

outputs:
  - name: q7764.out
    data: |
      46	51	23
      64	77	40
      75	67	58
